import { useRouter } from 'next/router';
import Layout from '../../components/Layout';
import Markdown from '../../components/Markdown';

export default function Post() {
  const router = useRouter();

  return (
    <Layout>
      <h1>{router.query.id}</h1>
      <Markdown>
{`

---

# h1 Heading 8-)
## h2 Heading
### h3 Heading
#### h4 Heading
##### h5 Heading
###### h6 Heading


## Horizontal Rules

___

---

***


  `}
      </Markdown>
    </Layout>
  );
}
